    private async Task RefreshVacunados()
    {
        Vacunados = await service.GetProductAsync();
    }

    private async Task DeleteVacunados(vacunados vacun)
    {
        await service.DeleteProductAsync(vacun);
        await RefreshVacunados();
    }



